  `sv_status` int(1) NOT NULL COMMENT '监督维护状态',
  `sv_note` text NOT NULL COMMENT '维护备注',
  `is_bao` int(1) NOT NULL DEFAULT '0' COMMENT '审核计划上报与否 1：报，0：未报',
  `bao_date` datetime NOT NULL COMMENT '上报日期',
  `bao_uid` int(11) NOT NULL COMMENT '上报人',
  `comment_a_uid` int(11) DEFAULT NULL COMMENT '一评人员ID',
  `comment_a_name` varchar(100) DEFAULT NULL,
  `fenpai_date` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '资料分派时间',
  `comment_b_uid` int(11) DEFAULT NULL COMMENT '二评人员ID',
