  `zy_uid` int(11) DEFAULT NULL,
  `zy_name` varchar(500) DEFAULT NULL COMMENT '专业管理人员',
  `comment_pass` int(11) DEFAULT '0' COMMENT '一评通过-》1 ',
  `comment_pass_date` date DEFAULT NULL COMMENT '评定问题发给组长时间 评定完成时间',
  `comment_date` date DEFAULT NULL COMMENT '通过时间-评定问题',
  `pd_type` int(1) DEFAULT '0' COMMENT '评定结果 0 未评定 1：通过 3：不通过 4：未整改  5：已整改',
  `assess_date` date DEFAULT NULL COMMENT '二评通过时间-认证决定-评定日期',
  `sp_date` date DEFAULT NULL COMMENT '总经理审批时间-证书发证开始日期',
  `comment_note` text COMMENT '评定备注',
  `rect_finish` int(1) DEFAULT '0' COMMENT '整改状态 0：未整改 1：已整改 2：无整改',
  `keep_decide` int(1) DEFAULT '0' COMMENT '标记是否发送保持通知1是2已发送',
  `audit_note` text COMMENT '项目组备注',
  `note` varchar(420) NOT NULL DEFAULT '' COMMENT '审核项目注释',
  `create_uid` int(11) NOT NULL COMMENT '创建人',
  `create_user` varchar(20) NOT NULL COMMENT '创建人',
  `create_date` datetime NOT NULL,
  `update_uid` int(11) NOT NULL COMMENT '更新人',
  `update_user` varchar(20) NOT NULL COMMENT '更新人',
  `update_date` datetime NOT NULL COMMENT '更新时间',
