  `assess_review_note` text,
  `test_review_note` text,
  `cost` decimal(10,2) DEFAULT NULL COMMENT '检查费',
  `test_cost` decimal(10,2) DEFAULT NULL COMMENT '检测费',
  `protocol_status` int(11) NOT NULL COMMENT '审核方案 状态，未安排、已安排',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`) USING BTREE,
  KEY `eid` (`eid`) USING BTREE,
  KEY `ep_manu_id` (`ep_manu_id`) USING BTREE,
  KEY `ep_prod_id` (`ep_prod_id`) USING BTREE,
  KEY `tid` (`tid`) USING BTREE,
  KEY `iso_prod_type` (`iso_prod_type`) USING BTREE,
  KEY `redata_status` (`redata_status`) USING BTREE
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COMMENT='审核项目' AUTO_INCREMENT=111 ;

