(4, '1001', '申报注册资格存在弄虚作假(如提供虚假学历、工作经历和认证经历等)', '申报注册资格时，存在弄虚作假(如提供虚假学历、工作经历和认证经历等)的。', '10', 0, 1, 0, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
