(6, '1003', '编造虚假文件，提供虚假认证记录和报告，导致认证结论失实的', '编造虚假文件，提供虚假认证记录和报告，导致认证结论失实的。', '10', 0, 3, 0, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
