(8, '1005', '认证人员没有得到受审核/检查方书面许可，故意泄漏受审核/检查方商业和技术秘密的', '认证人员没有得到受审核/检查方书面许可，故意泄漏受审核/检查方商业和技术秘密的。', '10', 0, 5, 0, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(9, '1006', '认证人员编造虚假的文件，提供虚假认证记录和报告，情节较轻微的', '认证人员编造虚假的文件，提供虚假认证记录和报告，情节较轻微的。', '8', 0, 6, 0, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(10, '1007', '认证人员认证过程中发生影响认证公正性和有效性行为的', '认证人员认证过程中发生影响认证公正性和有效性行为的。', '8', 0, 7, 0, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(11, '1008', '接受礼金、礼品及其他任何形式的好处', '接受受审核/检查方的礼金、礼品及其他任何形式的好处的；在受审核/检查方报销不合理的费用，提出不合理的食宿要求的；参加或暗示参加娱乐性活动及其他违反认证认可要求及注册准则规定的情况的。', '8', 0, 8, 0, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(12, '1009', '与受审核/检查方有利益冲突从而影响公正判决', '参与近两年内咨询、培训、服务过的受审核/检查方的认证工作，或兼职认证人员从业单位与受审核/检查方存在同行竞争关系，引起争议的。', '5', 0, 9, 0, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(13, '1010', '在认证期间不遵守计划时间，迟到或早退', '在认证期间不遵守计划时间，迟到、早退的。', '3', 0, 10, 0, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(14, '1011', '担保人员为其他注册申请人提供担保时，未了解申请人实际情况作虚假担保', '担保人员为其他注册申请人提供担保时，未了解申请人的实际情况，作虚假担保的。', '3', 0, 11, 0, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL),
(15, '1012', '未如实介绍个人背景（注册级别和专兼职状况，兼职应说明实际工作的处所）,引起争议的', '未如实介绍个人背景（注册级别和专兼职状况，兼职应说明实际工作的处所），引起争议的。', '2', 0, 12, 0, NULL, NULL, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00', NULL);
